import axios from 'axios';
import React, { useEffect, useState } from 'react';

const Sidebar = ({ onMenuItemClick }) => (
  <div className="w-64 absolute sm:relative bg-gray-800 shadow md:h-full flex-col justify-between hidden sm:flex">
    <div className="px-8">
      <div className="h-16 w-full flex items-center">
        <h1 className="text-white text-2xl font-bold">Admin Dashboard</h1>
      </div>
      <ul className="mt-12">
        <li
          className="flex w-full justify-between text-gray-300 hover:text-gray-500 hover:bg-gray-700 cursor-pointer items-center mb-6 p-2"
          onClick={() => onMenuItemClick('dashboard')}
        >
          <span className="text-sm">Dashboard</span>
        </li>
        <li
          className="flex w-full justify-between text-gray-300 hover:text-gray-500 hover:bg-gray-700 cursor-pointer items-center mb-6 p-2"
          onClick={() => onMenuItemClick('feedback')}
        >
          <span className="text-sm">Feedback</span>
        </li>
        <li
          className="flex w-full justify-between text-gray-300 hover:text-gray-500 hover:bg-gray-700 cursor-pointer items-center mb-6 p-2"
          onClick={() => onMenuItemClick('contact')}
        >
          <span className="text-sm">Contact</span>
        </li>
      </ul>
    </div>
  </div>
);

const Header = () => (
  <header className="w-full bg-gray-800 p-4">
    <div className="flex justify-between items-center">
      <div className="text-white text-2xl font-bold">Admin Dashboard</div>
      <div className="text-white">Welcome, Admin</div>
    </div>
  </header>
);

const MainContent = ({ view }) => {
  const [feedbackData, setFeedbackData] = useState([]);

  useEffect(() => {
    if (view === 'feedback') {
      axios.get('http://localhost:3000/feedback')
        .then(response => {
          setFeedbackData(response.data);
        })
        .catch(error => {
          console.error('Error fetching the feedback data:', error);
        });
    }
  }, [view]);

  return (
    <main className="flex-grow p-6 bg-cover bg-center bg-no-repeat" style={{ backgroundImage: 'url("/client/src/images/admin.jpg")' }}>
      {view === 'feedback' && (
        <div className="flex flex-wrap -mx-6">
          <div className="w-full md:w-1/2 xl:w-1/3 px-6">
            <div className="bg-white shadow-lg rounded-lg p-6">
              <h2 className="text-2xl font-bold mb-4">Feedback</h2>
              {feedbackData.length === 0 ? (
                <p>No feedback available</p>
              ) : (
                <ul>
                  {feedbackData.map((feedback, index) => (
                    <li key={index} className="mb-4">
                      <strong>Aspect:</strong> {feedback.aspect}
                      <br />
                      <strong>Satisfaction Level:</strong> {feedback.satisfaction_level}
                      <br />
                      <strong>Improvement Suggestions:</strong> {feedback.improvement_suggestions}
                    </li>
                  ))}
                </ul>
              )}
            </div>
          </div>
        </div>
      )}
    </main>
  );
};

const AdminDashboard = () => {
  const [view, setView] = useState('dashboard');

  const handleMenuItemClick = (view) => {
    setView(view);
  };

  return (
    <div className="bg-gray-100 font-sans leading-normal tracking-normal flex flex-no-wrap min-h-screen">
      <Sidebar onMenuItemClick={handleMenuItemClick} />
      <div className="w-full flex flex-col">
        <Header />
        <MainContent view={view} />
      </div>
    </div>
  );
};

export default AdminDashboard;
